import React from 'react'

function Apresentacao (props) {
  return <h1>Olá, {props.nome}! Você tem {props.idade} anos</h1>
}

function App () {
  return(
    <>
      <Apresentacao nome="Victor" idade="6"/>
      <Apresentacao nome="Marli" idade="62"/>
      <Apresentacao nome="Ayrton" idade="26"/>
    </>
  ) 
}

export default App
